import React from "react";

import { Router, Route, Switch } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";

import Register from "./pages/Register";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <Home></Home>
        </Route>
        <Route path="/login">
          <Login></Login>
        </Route>
        <Route path="/register" exact>
          <Register></Register>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
